import React from "react";
import "./Blog.css"


export default function Blog(props) {
    return (
        <>
            <div className="container7 mb-1">
                <h1 className={`head my-3 text-${props.mode === "light" ? "rgb(43, 45, 106)" : "white"}`}><strong>Explore technologies of Metaverse</strong></h1>
                <img src="https://www.hp.com/us-en/shop/app/assets/images/uploads/prod/What%20is%20Metaverse%20and%20What%20Does%20It%20Include1646428423311248.jpg" alt="" width={"75%"} height={"75%"} object-fit={"cover"} />
            </div>
            <footer>
                <div class={`container2 container2-${props.mode} bg-${props.mode === "light" ? "rgb(29, 79, 96)" : "dark"} `}>
                </div>
            </footer>

        </>
    )
}
